(65, 'consequuntur', 'A officiis ut eveniet in. Est porro eum tempore voluptatem. Voluptatum aut dolores cupiditate libero veritatis error et. Autem sequi sed rem quae minima dolores ad. Voluptas aut aut illum non molestiae totam excepturi autem.', '47527 Toy Corner', 0, 'mediano', 'buscado', '2022-07-17 19:28:13', '2022-07-17 19:28:13', NULL, NULL, '0.00000000', '0.00000000'),
(66, 'eveniet', 'Voluptates commodi eum aliquam magni ipsam. Sed eaque maiores non vel optio.', '136 Farrell Plains', 0, 'mediano', 'buscado', '2022-07-17 19:28:13', '2022-07-17 19:28:13', NULL, NULL, '0.00000000', '0.00000000'),
(69, 'aut', 'Voluptatum aut rerum iusto eveniet ipsa dolore error. Neque et saepe esse neque ipsum quis. Voluptatem impedit qui illo laborum quaerat totam. Cum dolore cum officia et aut.', '55210 Eusebio Alley', 0, 'pequenio', 'encontrado', '2022-07-17 19:28:13', '2022-07-17 19:28:13', NULL, NULL, '0.00000000', '0.00000000'),
(73, 'molestiae', 'Qui minima voluptatum vero et perspiciatis consectetur nihil. Ratione ratione nam aperiam necessitatibus nihil voluptatum assumenda. Quia enim molestiae repudiandae facilis.', '347 Cleta Mountains Apt. 657', 0, 'mediano', 'buscado', '2022-07-17 19:28:13', '2022-07-17 19:28:13', NULL, NULL, '0.00000000', '0.00000000'),
(74, 'Gafas graduadas', 'He ido de compras al centro de Granada y creo que se me han caído mis gafas de vista por la calle Mesones. Es muy importante que las recupere para poder ir a clase.', 'Calle Mesones, Granada, España', 1, 'pequenio', 'buscado', '2023-04-01 11:54:55', '2023-04-01 11:54:55', 3, 2, '37.17478980', '-3.60052480'),
(76, 'eligendi', 'Nam deserunt minus molestiae iure. Qui omnis placeat eos molestias hic omnis. Sapiente dignissimos odit rerum eos tempora rerum. Illo sed facere dolor consectetur. Et accusamus nostrum aut id.', '3018 Stehr Alley Suite 612', 0, 'grande', 'buscado', '2022-07-17 19:28:13', '2022-07-17 19:28:13', NULL, NULL, '0.00000000', '0.00000000'),
(78, 'Estuche pequeño', 'He perdido mi estuche en la universidad de psicología de Granada. Creo que la última vez que lo vi fue en la biblioteca. Tengo dentro mi bolígrafo de hacer los exámenes. Si alguien lo encuentra, por favor, que se ponga en contacto conmigo.', 'Campus Universitario Cartuja', 1, 'pequenio', 'buscado', '2023-04-01 11:48:09', '2023-04-01 11:48:09', 2, 6, '37.19295100', '-3.59732680'),
(81, 'Arnés Perro', 'He encontrado este arnés esta mañana mientras paseaba a mi perro por el parque Almunia (zona de columpios)', 'Avenida de Andalucía, Granada', 1, 'pequenio', 'encontrado', '2023-04-01 12:40:16', '2023-04-01 12:40:16', 3, 7, '37.19593670', '-3.63080820'),
(82, 'Libreta mini', 'Mini libreta con anillas moradas. Encontrada cerca del colegio Sagrado Corazón de Granada. No tiene nada escrito.', 'Calle Sta. Bárbara, Granada', 1, 'pequenio', 'encontrado', '2023-04-01 13:13:35', '2023-04-01 13:13:35', 3, 5, '37.18225350', '-3.60451910'),
(86, 'minima', 'Quas quo eum ex cum distinctio quibusdam nisi. Consequatur delectus nihil deleniti sit quasi. Qui dolorem est placeat consequatur. Ipsa quae omnis similique qui corrupti tenetur et fuga.', '711 Brent Spur Apt. 881', 0, 'grande', 'encontrado', '2022-07-17 19:28:13', '2022-07-17 19:28:13', NULL, NULL, '0.00000000', '0.00000000'),
(92, 'dolorum', 'Veritatis rerum velit eveniet voluptates explicabo perferendis necessitatibus. Excepturi quaerat voluptas nisi qui aliquam. Nihil laboriosam modi itaque rerum ducimus odio nesciunt.', '8640 Ebba Ridges', 0, 'grande', 'encontrado', '2022-07-17 19:28:13', '2022-07-17 19:28:13', NULL, NULL, '0.00000000', '0.00000000'),
(93, 'Paraguas Grande', 'Mi hermana ha encontrado este paraguas de camino al colegio en Alfacar. Está nuevo', 'Av. Federico García Lorca, Alfacar', 1, 'grande', 'buscado', '2023-02-21 18:56:01', '2023-02-21 18:56:01', 3, 7, '0.00000000', '0.00000000'),
(97, 'Gato Pardo', 'He encontrado este gato bebé cerca del polideportivo de Armilla. Es muy juguetón y parece muy limpio así que supongo que será de alguien.', 'C. León, Armilla (Granada)', 1, 'pequenio', 'encontrado', '2023-02-21 18:46:44', '2023-02-21 18:46:44', 1, 3, '0.00000000', '0.00000000'),
(98, 'Llaves de Coche', 'Llaves de coche de marca Opel, con un pompón rosa y una cuerda de florecitas. Fueron encontradas en la parada de bus de comedores (Universidad de Ciencias)', 'C. Rector Marín Ocete', 1, 'pequenio', 'encontrado', '2023-02-21 18:51:35', '2023-02-21 18:51:35', 4, 7, '0.00000000', '0.00000000'),
(99, 'quis', 'Ab dolores alias distinctio quod tempore. Impedit quam placeat a sit. Iusto aspernatur explicabo aspernatur. Esse aliquid quae laudantium unde et eveniet culpa. Consequatur cumque molestiae repellendus non animi eveniet.', '33328 Price Shores Apt. 100', 0, 'mediano', 'buscado', '2022-07-17 19:28:13', '2022-07-17 19:28:13', 5, 6, '0.00000000', '0.00000000'),
(100, 'Gafas de Vista', 'Encontradas estas gafas de vista cerca de una academia de inglés en Granada. Parece que tiene una alta graduación.', 'C. Miguel Delibes, La Zubia', 1, 'pequenio', 'buscado', '2023-02-21 19:08:31', '2023-02-21 19:08:31', 3, 4, '0.00000000', '0.00000000'),
(140, 'Gafas de Sol', 'Hemos encontrado estas gafas de sol esta mañana mientras dábamos un paseo por la playa. Parecen un poco deterioradas pero quizás su dueño las esté buscando.', 'Playa de las Azucenas, Motril', 1, 'pequenio', 'encontrado', '2023-02-21 18:51:19', '2023-04-10 07:16:20', 3, 7, '36.74897470', '-3.51803630'),
(141, 'Gata Perdida', 'Responde al nombre de Kira. Es muy cariñosa y confiada con la gente.\r\nSi alguien la ve, por favor póngase en contacto conmigo cuanto antes. \r\nNo sale de casa mucho y me da miedo que le pase algo, ya que es muy casera.', 'C. Calderón, Santa Fe, Granada', 1, 'pequenio', 'buscado', '2023-02-21 18:51:02', '2023-04-02 07:15:45', 1, 10, '37.19085180', '-3.71829760');
