INSERT INTO `faqs` (`id`, `pregunta`, `respuesta`, `created_at`, `updated_at`) VALUES
(1, '¿Cómo puedo registrar un objeto que he encontrado?', 'Te recomendamos que primero eches un vistazo a la lista de objetos buscados para ver si alguien ya está buscando ese objeto perdido.\n            Si no se encuentra ahí, puedes registarlo a través del formulario:\n            <a class=\"text-blue-gray-dark\" href=\"#\">Registrar Objeto Encontrado</a>', '2022-07-17 19:29:09', '2022-07-17 19:29:09'),
(2, '¿Cómo puedo registrar un objeto que estoy buscando?', 'Te recomendamos que primero eches un vistazo a la lista de objetos encontrados para ver si alguien lo ha encontrado.\n            Si no se encuentra ahí, puedes registar tu objeto a través del formulario:\n            <a class=\"text-blue-gray-dark\" href=\"#\">Registrar Objeto Buscado</a>', '2022-07-17 19:29:09', '2022-07-17 19:29:09'),
(3, '¿Cómo puedo buscar un objeto?', 'Si se trata de un objeto que estás buscando, puedes hacerlo a través de:\n            <a class=\"text-blue-gray-dark\" href=\"#\">Lista Objetos Buscados</a>\n            Si se trata de un objetoque has encontrado, puedes hacerlo a través de:\n            <a class=\"text-blue-gray-dark\" href=\"#\">Lista Objetos Encontrados</a>', '2022-07-17 19:29:09', '2022-07-17 19:29:09'),
(4, '¿Cómo puedo contactar con la persona que encontró mi objeto?', 'Primero deberás haberte registrado e iniciado sesión a través de:\n            <a class=\"text-blue-gray-dark\" href=\"#\">Registrarse/Inicio Sesión</a>\n            Después desde la ficha del objeto encontrarás el botón \"Contactar\"', '2022-07-17 19:29:09', '2022-07-17 19:29:09'),
(5, '¿Puedo denunciar un mal comportamiento en la web?', 'Sí, podrás hacerlo a través del formulario que encontrarás en:\n                <a class=\"text-blue-gray-dark\" href=\"#\">Contacta con Nosotros</a>', '2022-07-17 19:29:09', '2022-07-17 19:29:09');
